  { name: 'BMW 5 Series', description: 'Luxury and performance perfectly balanced.', img: 'link_to_image' },
  { name: 'BMW 7 Series', description: 'The ultimate in luxury sedans.', img: 'link_to_image' },
  { name: 'BMW X1', description: 'Compact and versatile SUV.', img: 'link_to_image' },
  { name: 'BMW X3', description: 'A midsize SUV for all your adventures.', img: 'link_to_image' },
  { name: 'BMW X5', description: 'Powerful and spacious SUV.', img: 'link_to_image' },
  { name: 'BMW X6', description: 'Coupe-inspired SUV with a bold design.', img: 'link_to_image' },
  { name: 'BMW Z4', description: 'Sporty and stylish roadster.', img: 'link_to_image' },
  { name: 'BMW i3', description: 'Innovative electric car.', img: 'link_to_image' },
  { name: 'BMW i8', description: 'Futuristic plug-in hybrid sports car.', img: 'link_to_image' },
  { name: 'BMW M2', description: 'Compact high-performance coupe.', img: 'link_to_image' },
  { name: 'BMW M3', description: 'Legendary high-performance sedan.', img: 'link_to_image' },
  { name: 'BMW M4', description: 'High-performance coupe with a racing spirit.', img: 'link_to_image' },
  { name: 'BMW M5', description: 'Super sedan with thrilling performance.', img: 'link_to_image' },
  { name: 'BMW M8', description: 'Ultimate luxury and performance in a coupe.', img: 'link_to_image' }
];
*/
function Services() {
  return (
    <div>
      <h1>Our Services</h1>
      <p>At BMW, we offer a variety of services to ensure your vehicle remains in top condition:</p>
      <ul>
        <li>Maintenance and Repairs</li>
        <li>Financing and Leasing Options</li>
        <li>24/7 Roadside Assistance</li>
        <li>Customization and Accessories</li>
      </ul>
      <h2>Our Models</h2>
      <div className="car-models">
        {carModels.map((model, index) => (
          <div key={index} className="car-model">
            <img src={model.img} alt={model.name} />
            <h3>{model.name}</h3>
            <p>{model.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Services;
